import{_ as l,W as i,X as e,a0 as r}from"./framework-b4edc447.js";const t={},c=r('<h1 id="常用服务默认端口号" tabindex="-1"><a class="header-anchor" href="#常用服务默认端口号" aria-hidden="true">#</a> 常用服务默认端口号</h1><ul><li>端口号标识了一个主机上进行通信的不同的应用程序。</li><li>HTTP协议代理服务器常用端口号：80/8080/3128/8081/9098</li><li>SOCKS代理协议服务器常用端口号：1080</li><li>FTP（文件传输）协议代理服务器常用端口号：21</li><li>Telnet（远程登录）协议代理服务器常用端口号：23</li><li>HTTP服务器，默认端口号为80/tcp（木马Executor开放此端口）</li><li>HTTPS（securely transferring web pages）服务器，默认端口号为443/tcp 443/udp</li><li>Telnet（不安全的文本传送），默认端口号为23/tcp（木马Tiny Telnet Server所开放的端口）</li><li>FTP，默认的端口号为21/tcp（木马Doly Trojan、Fore、Invisible FTP、WebEx、WinCrash和Blade - Runner所开放的端口）</li><li>TFTP（Trivial File Transfer Protocol），默认端口号为69/udp</li><li>SSH（安全登录）、SCP（文件传输）、端口号重定向，默认的端口号为22/tcp</li><li>SMTP Simple Mail Transfer Protocol（E-mail），默认端口号为25/tcp（木马Antigen、Email - Password Sender、Haebu Coceda、Shtrilitz Stealth、WinPC、WinSpy都开放这个端口）</li><li>POP3 Post Office Protocol（E-mail），默认端口号为110/tcp</li><li>Webshpere应用程序，默认端口号为9080</li><li>webshpere管理工具，默认端口号9090</li><li>JBOSS，默认端口号为8080</li><li>TOMCAT，默认端口号为8080</li><li>WIN2003远程登录，默认端口号为3389</li><li>Symantec AV/Filter for MSE,默认端口号为 8081</li><li>Oracle 数据库，默认的端口号为1521</li><li>ORACLE EMCTL，默认的端口号为1158</li><li>Oracle XDB（XML 数据库），默认的端口号为8080</li><li>Oracle XDB FTP服务，默认的端口号为2100</li><li>MS SQL*SERVER数据库server，默认的端口号为1433/tcp 1433/udp</li><li>MS SQL*SERVER数据库monitor，默认的端口号为1434/tcp 1434/udp</li><li>Microsoft RDP 微软远程桌面使用的端口号：1863/tcp</li><li>Symantec pcAnywhere 远程控制数据传输时使用的端口号：5631/tcp</li><li>Symantec pcAnywhere 主控端扫描被控端时使用的端口号：5632/udp</li><li>MS SQL Server使用的端口号：5000/tcp</li><li>腾讯QQ端口号：8000/udp</li></ul>',2),a=[c];function n(o,s){return i(),e("div",null,a)}const S=l(t,[["render",n],["__file","常用服务默认端口号.html.vue"]]);export{S as default};
